import React from 'react'
import { userArray1 } from '../Login/Login'
import { isUserLoggedIn } from '../../util'

export default function Name() {
    const isLoggedIn = isUserLoggedIn()

    return (
        <div className='name-container'>
            <div className='name'>
                <div>
                    <div className='username'>
                        {{
                            if(isLoggedIn) {
                                {
                                    userArray1.map((username) => <b>{username}</b>)
                                }
                            },
                        }}
                    </div>
                    <div className='username'>1234567890</div>
                    <div className='username'>dav2005@gmail.com</div>
                </div>
            </div>
            <div className='edit'>
                <button className='edit-profile'>EDIT PROFILE</button>
            </div>
        </div>
    )
}
